export default {
  name: "expandRow",
  props: {
    row: Object
  },
  data() {
      return {
          r:this.row,
      };
  },
  computed:{
      contentType:function() {
          if (this.row.contentType == 0) {
              return "再生资源回收";
          } else if(this.row.contentType == 1) {
              return "市政工程";
          }else if(this.row.contentType == 2) {
              return "环卫保洁";
          }else if(this.row.contentType == 3) {
              return  "绿化工程";
          }else if(this.row.contentType == 4) {
              return  "装修装饰";
          } else{return "其它";}
      },  
      content:function() {
          return this.row.content;
      },

  },
};
